import React from "react";
import "./App.css";
import Post from "./component/Post";

import avatar1 from "./assets/manpal.jpg";
import avatar2 from "./assets/subho.jpg";
import avatar3 from "./assets/netflix1.png";
import avatar4 from "./assets/netflix2.png";

function App() {
  const [posts, setPosts] = useState([
    {
      username:"manpal",
      caption:"wow it is working",
      imageUrl:{avatar1}
    },
    {
      username:"Subhosree",
      caption:"subho it is working",
      imageUrl:{avatar2}
    }
  ])
  return (
    <div className="app">
      <div className="app_header">
        <img
          className="app_headerImage"
          src="https://www.instagram.com/static/images/web/mobile_nav_type_logo.png/735145cfe0a4.png"
          alt="app_logo"
        />
      </div>

      {posts.map( (post) => (
        <Post username = {post.username} 
              caption = {post.caption}
              imageUrl = {post.imageUrl}      
        />
      ))
    }


      <Post
        username="Manishs"
        caption="manisha it is working"
        imageUrl={avatar3}
      />

      <Post
        username="Shubham"
        caption="wow shubham it is working"
        imageUrl={avatar4}
      />
    </div>
  );
}

export default App;
